import React from 'react'
import head from '../../../../../public/assets/Kody/head.png'
import body from '../../../../../public/assets/Kody/body.png'


const AnimatedKody = () => {
  return (
    <div className='relative'>
        <img src={head} alt="kody"  width={200}/>
        <img Src={body} alt="kody" width={200} />
    </div>
  )
}

export default AnimatedKody
